import Vue from 'vue'
import Router from 'vue-router'
import home from '../views/Home.vue'
import overview from '../views/Overview.vue'
 
Vue.use(Router)
 
export default new Router({
  routes: [
    {
      path: '/index',
      name: 'HomePage',
      component: home
    },
    {
    	path: '/overview',
      name: 'OverviewPage',
      component: overview
    }
  ]
})
